import React from 'react';
// import styled from 'styled-components'
import cyzone1 from '../../images/cyzone1.jpg'
import cyzone2 from '../../images/cyzone1.jpg'
import { Gallery, GalleryImage } from 'react-gesture-gallery'

const images = [{
  url : ".cyzone2/",
  brand : "CYZONE" 
},{
  url : cyzone1,
  brand : "CYZONE"
},{
  url : "https://drive.google.com/file/d/1jsGJGfeW4PgO96qSPLstbMZRP3EbqM6N/view?usp=sharing",
  brand : "ESIKA"
},{
  url : "https://drive.google.com/file/d/1xSebzODIEnVQu2CZYYciN8Yoao9iKAeq/view?usp=sharing",
  brand : "ESIKA"
},{
  url : "https://drive.google.com/file/d/1Uks9RKH_HixPEkAUch1u_nF-I3dZvlc8/view?usp=sharing",
  brand : "ESIKA"
}];

export const Slider = () => {
  return(
    <Gallery index={0}>
      {images.map(img => (
        <GalleryImage src={img.url} />
      ))}

    </Gallery>
  )
};
